import http from './httpService';
import apiUrl from '../config.json';

const { apiUrl: ApiUrl } = apiUrl;
const apiEndpoint = ApiUrl + "api/auth";
export function login(data) {
    return http.post(apiEndpoint, {
        email: data.email,
        password: data.password
    })
}
